import Vue from "vue";
import { createRouter, createWebHistory } from "vue-router";

import MtMainView from "../views/MtMainView.vue";

import MtHomePage from "../pages/MtHomePage.vue";
import MtSchedulePage from "../pages/MtSchedulePage.vue";

Vue.use({ createRouter, createWebHistory });

export default new { createRouter, createWebHistory }({
  mode: "history",
  routes: [
    {
      path: "/main",
      redirect: "/",
      name: "Main",
      component: MtMainView,
      children: [
        {
          path: "/",
          name: "Home",
          component: MtHomePage,
        },
        {
          path: "/schedule",
          name: "Schedule",
          component: MtSchedulePage,
        },
      ],
    },
  ],
});
